# @lc code=start
class Solution(object):
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        left = right = 0
        len_s1 = len(s1)
        len_s2 = len(s2)
        needed = {}
        for i in range(len_s1):
            if s1[i] not in needed:
                needed[s1[i]] = 1
            else:
                needed[s1[i]] += 1
        window = {}
        valid = 0
        
        while right < len_s2:
            c = s2[right]
            right += 1 # 扩张滑动窗口
            if c in needed:
                if c not in window:
                    window[c] = 1
                else:
                    window[c] += 1
                if c in window and window[c] == needed[c]:
                    valid += 1

            # while right - left >= len_s1:
            #     if valid == len(needed):
            #         return True
            while valid == len(needed):
                if right - left == len_s1:
                    return True
                c = s2[left]
                left += 1 # 收缩滑动窗口
                if c in needed:
                    if window[c] == needed[c]:
                        valid -= 1
                    window[c] -= 1
        return False



    def checkInclusion1(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        len_s1 = len(s1)
        len_s2 = len(s2)
        if len_s1 > len_s2:
            return False
        if len_s1 == 0:
            return True

        needed = {} 
        
        
        for i in range(len_s1):
            if s1[i] not in needed:
                needed[s1[i]] = 1
            else:
                needed[s1[i]] += 1
        
        for i in range(len_s2):
            window = {}
            valid = 0
            if s2[i] in needed:
                for j in range(i, i+len_s1):
                    if j >= len_s2:
                        break
                    if s2[j] in needed:
                        if s2[j] not in window:
                            window[s2[j]] = 1
                        else:
                            window[s2[j]] += 1
                        if window[s2[j]] == needed[s2[j]]: 
                            valid += 1
                if valid == len(needed):
                    return True
        return False

if __name__ == '__main__':
    s1 = ''
    s2 = ''
    print(Solution().checkInclusion(s1, s2))
        
